import React from 'react';
import MovieRow from '../components/movies/MovieRow';
import TvRow from '../components/tvs/TvRow';
import styles from './Home.module.css';

const base_url = 'https://image.tmdb.org/t/p/original';
// const url =
//   'https://api.themoviedb.org/3/movie/popular?api_key=8a45061d820fb7b5b5f574766f028ff6';

const Home = () => {
  return (
    <div className={styles.home}>
      <h3 className={styles.title}>Home</h3>
      <div>
        <p>Favorite</p>
        <p>No favorites yet.</p>
      </div>
      <MovieRow
        url="/movie/now_playing?api_key=8a45061d820fb7b5b5f574766f028ff6"
        category="Movies"
        cname="wide"
      />
      <TvRow
        url="/tv/on_the_air?api_key=8a45061d820fb7b5b5f574766f028ff6"
        category="TV Shows"
        cname="wide"
      />
    </div>
  );
};

export default Home;
